import React from "react";
import { Switch, Route, Redirect } from "react-router-dom";
import testTheme from "../mainWindow/testTheme.js";

export const TestRoutes = () => {
  return (
    <Switch>
      <Route path="/test/1" exact component={testTheme}></Route>
    </Switch>
  );
};
